import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    const cardComponent = robots.map(user => {
        <Card id={user.id} name={user.name} email={user.email} />
    })
    return (
        <div>
            cardComponent
        </div>
    );
}

export default CardList;
